package FirstClass.java;

public class loopingstsEg{

	public static void main(String[] args){
		// TODO Auto-generated method stub
		
		
		for(int i=1;i<20;i++){
			
			System.out.println(i);
		}
		
		for(int i=20; i>=1; i--){
			System.out.println(i);
		}
		
		
		// while loop
		int j=1;
		while(j<= 5) {
			System.out.println(j);
			j++;
		}
		
	

	}

}
